import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('RobotoCondensed-VariableFont_wght-normal.ttf', font);
this.addFont('RobotoCondensed-VariableFont_wght-normal.ttf', 'RobotoCondensed-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
